import React, { Component } from "react";

class Description extends Component {
  state = {};
  constructor(props) {
    super(props);
    console.dir(props);
  }
  render() {
    return <React.Fragment>{console.log(this.props)}</React.Fragment>;
  }
}

export default Description;
